import React from 'react'
import { Link } from 'react-router-dom';
import AxiosRequest from '../../axios';
import { useNavigate } from 'react-router';




const Logout = () => {
    const navigate = useNavigate();

    const HandleLogout = () => {
        AxiosRequest.post('', {refresh_token:localStorage.getItem('refresh_token')});
        localStorage.removeItem('access_token')
        localStorage.removeItem('refresh_token')
        AxiosRequest.defaults.headers['Authorisation'] =null;

        navigate("/login");
    }
    return (

        <div align="center">
        <div className="card-body">
            <div className='container col-md-6 mt-4'>
            <h1>Are you sure you want to logout</h1>
            <div className='mt-4' style={{display:"flex",flexDirection:"row",justifyContent:"space-around",alignItems:"center"}}>
            <Link to="/"><button type="button" class="btn btn-dark">No take me back</button></Link>
            <Link to="/login"><button type="button" class="btn btn-danger">Yes logout</button></Link>
            </div>
        </div>
        </div>
        </div>
    )
}

export default Logout;
